  01> WILLIAMS, Felicity m on 24.08.1973 to (2)GILBERTSON, Graeme Menzies
  b 09.08.1945
  b 09.12.1936
  Felicity m, at Waipukurau. Graeme, slo Roy Gilbertson and Betty Menzies, b. at Napier. Address: 29
  Hillcrest Street, Masterton.
  Felicity is presently a part-time secretary/treasurer and Graeme is a retired farm manager living in
  Havelock North.
  01> GILBERTSON, Christopher Graeme Menzies
  b 09.05.1976
  Christopher b. at Rotorua.
  He was educated at Rathkeale College and is now travelling in England.
